import React, { Component } from 'react';

	export default class App extends Component {
		render() {
			return (
                <li>
                    <div className="item-container">
                        <h3>{this.props.beer.name}</h3>
                        <img src={this.props.beer.labels.icon} alt={this.props.beer.name} />
                        <span>IBU: {this.props.beer.ibu} | </span><span>ABV: {this.props.beer.abv}%</span>
                    </div>
                </li>
			)
		}
	}
